    def parse(self, response):

        caracteristici = []
        titluCaracteristic = ""
        valoriCaracteristic = ""
        for caracteristic in response.css('div#b_detalii_caracteristici ul li'):
            titluCaracteristic = caracteristic.css('li::text').get()
            valoriCaracteristic =caracteristic.css('span::text').get()
            caracteristici.append({"titluCaracteristic": titluCaracteristic, "valoriCaracteristic" : valoriCaracteristic})
        
        imagini = response.css('div#galerie_detalii a.imagine_galerie::attr(href)').getall()
        descriere = response.css('div.descriere-oferta div.descriere-oferta__text').getall()
        dataActualizare = response.css('span.data-actualizare::text').get()
        idAnunt = response.css('span.id::text').get()
        utilitati = response.css('ul.utilitati span::text').getall()
        specificatii = response.css('div#b_detalii_specificatii span::text').getall()
        pret = response.css('div.pret span::text').getall()
        pretReal = response.css('div.preturi div.pret span::text').getall()

        yield {
            "imagini": imagini,
            "caracteristici": caracteristici,
            "descriere" : descriere,
            "dataActualizare": dataActualizare,
            "utilitati" : utilitati,
            "specificatii" : specificatii,
            "pret": pret ,
            "pretReal": pretReal,
            "url": response.request.url,
            "idAnunt": idAnunt.split(" ")[2]   
         }